package mysql

import (
	"davinci/common/log"
	"fmt"
	"strings"
)

var LINUX_X64_UDF_HEX = ""
var LINUX_X32_UDF_HEX = ""
var WIN_X64_UDF_HEX = ""
var WIN_X32_UDF_HEX = ""

var MysqlUdfMap = map[string]string{
	"linux_64": LINUX_X64_UDF_HEX,
	"linux_32": LINUX_X32_UDF_HEX,
	"win_64":   WIN_X64_UDF_HEX,
	"win_32":   WIN_X32_UDF_HEX,
}

func GetMysqlUdf(os, platform string) string {
	log.Info(fmt.Sprintf("os: %s , platform: %s", os, platform))
	os = strings.ToLower(os)
	platform = strings.ToLower(platform)
	if strings.HasSuffix(os, "lin") {
		os = "linux"
	} else if strings.HasSuffix(os, "win") {
		os = "win"
	}

	if strings.HasPrefix(platform, "x86_") {
		if strings.Contains(platform, "64") {
			platform = "64"
		} else {
			platform = "32"
		}
	}
	udfHex := MysqlUdfMap[fmt.Sprintf("%s_%s", os, platform)]
	if udfHex == "" {
		log.Warn("no udf found for the os and platform")
	}
	return udfHex
}
